input = DATA.read.chomp

def reduce(polymer)
  polymer.chars.reduce('') do |acc, c|
    if !acc.empty? && acc[-1] == c.swapcase
      acc = acc[0..-2]
    else
      acc << c
    end
  end
end

puts (reduced = reduce(input)).length

min = ('a'..'z').map do |c|
  reduce(reduced.delete(c + c.upcase)).length
end.min
puts min

__END__

